import './Quote.css';

// Quote component view
export default function REturnQuOte() {
 return (
  <div className='flex-quote-nuetras'>
   <h2>Envia, recibe y solicita dinero</h2>
   <p>Lors de la comparaison des types de paramètres de fonction, l'affectation réussit si le paramètre source peut être affecté au paramètre cible, ou vice versa.</p>
  </div>
 );
};
